import React from "react";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import vector3 from "./images/Vector 3.png";
import vector4 from "./images/Vector 4.png";

const imageContainerStyle = {
  position: "relative",
};

const imageStyle = {
  position: "absolute",
  top: 0, // Ajustez la position verticale au besoin
  right: -15, // Positionner l'image tout à droite de l'écran
};

function ShapeExample() {
  return (
    <Container>
      <Row>
        <Col className="justify-content-end">
          {" "}
          {/* Ajouter la classe Bootstrap pour aligner à droite */}
          <div style={imageContainerStyle}>
            <img src={vector3} alt="Vector 3" style={imageStyle} />
          </div>
          <div style={imageContainerStyle}>
            <img src={vector4} alt="Vector 4" style={imageStyle} />
          </div>
        </Col>
      </Row>
    </Container>
  );
}

export default ShapeExample;
